\n\r\n\r\n\r\n\r\n');DELETE FROM frontmaincontent_tblINSERT INTO frontmaincontent_tbl VALUES('1', '<font style=\"font-family: times new roman;\" size=\"2\"><font size=\"4\"><center><b>Commission on Higher Education</b>\r\n<b>(CHED)</b></center></font></font><br style=\"font-family: comic sans ms;\"><font size=\"2\"><span style=\"font-family: georgia;\"><br><span style=\"font-style: italic;\">The</span> </span><font size=\"3\"><b style=\"font-family: georgia;\">Commission on Higher Education</b></font><span style=\"font-family: georgia; font-style: italic;\"><span style=\"font-weight: bold;\"> </span>was created on May 18, 1994&nbsp;through the passage of Republic Act No. \r\n7722, or the Higher Education Act of 1994. CHED, an attached agency to \r\nthe Office of the President for administrative purposes, is headed by \r\na&nbsp;chairman and four commissioners, each having a term of office of four \r\nyears. The&nbsp;Commission </span><b style=\"font-family: georgia; font-style: italic;\">En Banc\r\n</b><span style=\"font-family: georgia; font-style: italic;\">\r\n&nbsp;acts as a collegial body in formulating plans, policies and \r\nstrategies&nbsp;relating to higher education and the operation of CHED. The \r\ncreation of CHED was part of a broad agenda of reforms on the \r\ncountry’s&nbsp;education system outlined by the Congressional Commission on \r\nEducation </span><b style=\"font-family: georgia; font-style: italic;\">(EDCOM)</b><span style=\"font-family: georgia; font-style: italic;\">\r\n&nbsp;in&nbsp;1992. Part of the reforms was the trifocalization of the education \r\nsector into three&nbsp;governing bodies: the CHED for tertiary and&nbsp;graduate \r\neducation, the Department of Education </span><b style=\"font-family: georgia; font-style: italic;\">(DepEd)</b><span style=\"font-family: georgia; font-style: italic;\">\r\n&nbsp;for basic education and the&nbsp;Technical Education and Skills Development Authority </span><b style=\"font-family: georgia; font-style: italic;\">(TESDA)</b><span style=\"font-family: georgia; font-style: italic;\">\r\n&nbsp;for technical-vocational&nbsp;and middle-level education.</span></font><br><font size=\"2\">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n				\r\n				\r\n				\r\n				\r\n				\r\n				\r\n				</font>\r\n				\r\n				\r\n				\r\n				\r\n				\r\n				\r\n				\r\n				\r\n				');DELETE FROM grade_tblINSERT INTO grade_tbl VALUES('1', '2011-2012', '1', '1', 'Physics 1', 'Major', '4', '3.5', '17');INSERT INTO grade_tbl VALUES('2', '2011-2012', '1', '1', 'Computer Programming 1', 'Major', '4', '4', '17');INSERT INTO grade_tbl VALUES('3', '2011-2012', '1', '1', 'Physical Education 1', 'Minor', '1', '3', '14');INSERT INTO grade_tbl VALUES('4', '2011-2012', '1', '1', 'Algebra', 'Minor', '2', '3', '14');INSERT INTO grade_tbl VALUES('5', '2011-2012', '1', '1', 'Data Structures', 'Major', '4', '3', '14');INSERT INTO grade_tbl VALUES('6', '2011-2012', '1', '1', 'Math Plus', 'Major', '1', '1', '14');INSERT INTO grade_tbl VALUES('7', '2011-2012', '1', '1', 'Professional Ethics', 'Minor', '1', '3', '14');INSERT INTO grade_tbl VALUES('8', '2011-2012', '1', '1', 'Computer Programming 1', 'Minor', '3', '3', '14');INSERT INTO grade_tbl VALUES('9', '2011-2012', '1', '1', 'BASIC CONCEPTS', 'Major', '4', '4', '2');INSERT INTO grade_tbl VALUES('10', '2005-2006', '1', '1', 'COMPUTER PROGRAMMING 1', 'Major', '4', '4', '2');INSERT INTO grade_tbl VALUES('11', '2011-2012', '1', '1', 'Probability and Statistics', 'Minor', '2', '3', '17');INSERT INTO grade_tbl VALUES('12', '2011-2012', '1', '1', 'Programming 1', 'Major', '4', '2', '17');INSERT INTO grade_tbl VALUES('13', '2011-2012', '1', '1', 'Physical Education 1', 'Minor', '1', '1', '17');INSERT INTO grade_tbl VALUES('14', '2011-2012', '1', '1', 'COMPUTER PROGRAMMING 1', 'Major', '4', '1', '30');DELETE FROM grant_tblINSERT INTO grant_tbl VALUES('1', 'FULL', 'SCHOLARSHIP', 'Full-Merit - 15,000.00/sem', 'This program is for bright Filipinos students who got the highest